import React, { Component } from "react";
import "./App.css";

class App extends Component {
  componentDidMount() {
    this.getBackground();
  }

  render() {
    return (
      <div className="wikipedia">
        <h1>Wikipedia viewer</h1>
        <p>Search for:</p>
        <input type="text" placeholder="Search" />

        <canvas id="c" />
      </div>
    );
  }
}

export default App;
